import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import {withCharacter} from './MyProvider'

class Spells extends Component {
    render(){
        return(
            <div className='spells'>
                <br/>
                <Link to={'/spell'+ this.props.id}>{this.props.spell}</Link>
                <br/>
            </div>
        )
    }
}

export default withCharacter(Spells)

